import React from 'react';
import { connect } from 'redux-bundler-react';
import ToggleButton from './toggle-button';
import BaseMapSwitcher from './basemap-switcher';
import HelpButton from "./help-button";
import downloadButton from './download-button';

class Toolbar extends React.Component{
    render(){
        const { drawSelect, drawDownload } = this.props;
        const tools = [{
            toolTip: "Select Features for removal",
            className: "ms ms-select-arrow",
            interaction: drawSelect
        },
        {
            toolTip: "Download Structures for Features",
            className: "ms ms-select-arrow",
            interaction: drawDownload
        }
    
    ]
        return (
            <div className="container-fluid mt-3" style={{position:'absolute',zIndex:2}}>
                <div className="float-right">
                    <HelpButton/>
                    <BaseMapSwitcher/>
                </div>
                <div className="float-left">
                    <ToggleButton toolTip = {"Select Features for Removal"} className = {"ms ms-select-arrow"} interaction = {drawSelect}/>
                    <downloadButton toolTip = {"Download structures for features"} className = {"ms ms-select-arrow"} interaction = {drawDownload}/>
                }
                </div>
            </div>
        )
    }
}
export default connect(
    'selectDrawPolygons',
    'selectModify',
    'selectDrawSelect',
    Toolbar
);
